package PracticePrograms;

public class ArrayValuesPrintingInReverseOrder {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String[]names= {"meghana","anitha","ramya"};
   	 //printing array values in reverse order
   	 for(int i1=names.length-1;i1>=0;i1--) {  
       	 System.out.println(names[i1]);
	}

   }
}
